import React from 'react'

export default function decoder(img){
    console.log(typeof img)
    if (img!= 'no image'){
        var image = new Image();
        var img_str = String(img)
        var cleanImange = img_str.substring(2, img_str.length - 1)
        image.src = `data:image/png;base64,${cleanImange}`;
        return(image.src)

    }
    else{
        return ""
    }

    }
